// UI Imports
import grey from '@material-ui/core/colors/grey'

// Component Styles
const styles = theme => ({
  root: {
    padding: theme.spacing(),
    backgroundColor: grey[500]
  },

  grow: {
    flexGrow: 1
  }
})

export default styles
